class LoadMembers:
    def __init__(self):
        pass

    @transaction.atomic
    def load_members(self) -> None:
        for x in people:
            first_name = x.get("first_name")
            last_name = x.get("last_name")
            id_number = x.get("id_number")
            department = x.get("department")
            branch = x.get("branch")
            email = x.get("email")
            phone_number = x.get("phone_number")
            role = x.get("role")
            member_since = x.get("member_since")
            gender = x.get("gender")
            address = x.get("address")
            city = x.get("city")
            country = x.get("country")

            user = User.objects.filter(email=email).first()
            if user:
                print(f"User with email {email} already exists. Skipping...")
            else:
                user = User.objects.create(
                    first_name=first_name,
                    last_name=last_name,
                    id_number=id_number,
                    email=email,
                    role=role,
                    phone_number=phone_number,
                    username=email,
                    gender=gender,
                    address=address,
                    city=city,
                    country=country,
                    password="1234" 
                )
                
                Member.objects.create(
                    user=user,
                    member_since=member_since,
                    position=role,
                    department_id=department,
                    branch_id=branch,
                    status="Active"
                )
                print("Members loaded successfully.")
